INSERT INTO `valida_plan2_ges_observaciones_sr` (`id`, `observacion`, `id_controlador`, `fecha_registro`, `observado`, `id_jefe_observa_id`, `id_periodo_id`, `user_observa_id`, `id_objetivo_operativo_id`, `id_objetivo_tactico_id`, `id_objetivo_tacticotn_id`) VALUES
	(151, 'agregar analista acordada', 67, '2020-11-20 13:29:29.645585', 0, NULL, 3, 5121, 325, NULL, NULL),
	(152, '©', 54, '2020-11-22 21:29:52.932638', 0, NULL, 3, 7149, 62, NULL, NULL),
	(153, 'No ingresa actividades', 55, '2020-11-22 21:31:13.841926', 0, NULL, 3, 7149, 352, NULL, NULL),
	(154, 'No ingresa actividades', 76, '2020-11-22 21:32:33.786858', 0, NULL, 3, 7149, 351, NULL, NULL),
	(155, 'No ingresa actividades', 76, '2020-11-22 21:33:24.976405', 0, NULL, 3, 7149, 69, NULL, NULL),
	(156, 'Faltan asignar actividades', 53, '2020-11-23 01:25:53.612682', 0, NULL, 3, 7149, 61, NULL, NULL),
	(157, 'Faltan algunas actividades ', 75, '2020-11-23 13:26:08.560261', 0, NULL, 3, 7149, 64, NULL, NULL),
	(158, 'Falta actividades', 54, '2020-11-23 13:27:32.370303', 0, NULL, 3, 7149, 63, NULL, NULL),
	(159, 'se requiere revisar la asignación de horas, que es más visible en las actividades semanales, como: asesoramiento a actividades DN de prensa (156 horas semanales jefe subdepartamento); registro y seguimiento tareas teletrabajo (106 horas semanales para 1 funcionario), etc. Por favor, hacer revisión de registro de las horas y de la periodicidad, tal vez hay un error en esta etapa o la sobre estimación de tiempo, que no es coherente con el tiempo requerido para la actividad ni las horas disponibles del equipo', 70, '2020-11-23 15:09:22.841470', 0, NULL, 3, 7425, 334, NULL, NULL),
	(160, 'En términos generales, al no señalarse los productos a los que se asocian las actividades pudiera existir duplicación de las horas de trabajo asociadas a las distintas familias de cargo.  Hay una sobre planificación de actividades en relación a las horas disponibles del subdepartamento. Genera confusión, en términos de horas asignadas, a actividades como publicaciones metodológicas trimestrales; elaboración documentos asociados a productos estadísticos trimestrales; gestión comunicacional de productos estadísticos estructurales, entre otros. Existe coherencia de la carga laboral asociada a las horas y competencias de cada profesional a nivel de mes, trimestre, año?. Adicionalmente, podría agregarse algunos elementos que clarifiquen la agregación de valor de actividades de gestión comunicacional (gestión de medios, publicaciones, etc). ', 70, '2020-11-23 15:24:40.817991', 0, NULL, 3, 7425, 333, NULL, NULL),
	(161, 'En general revisar la cantidad de horas asignadas a las actividades de jefaturas.', 70, '2020-11-23 15:29:12.181965', 0, NULL, 3, 7425, 382, NULL, NULL),
	(162, 'Revisar hora ', 38, '2020-11-23 16:24:20.542763', 0, NULL, 3, 4647, 36, NULL, NULL),
	(163, 'No me queda claro que la asignación de carga de trabajo por analista sea una actividad, al menos así descrita. Tal vez, en un contexto de coordinación y planificación del área, me suena más coherente con el objetivo', 69, '2020-11-23 20:11:57.431636', 0, NULL, 3, 9076, NULL, NULL, 184),
	(164, 'La gestión del cumplimiento de los compromisos CDC, debieran ser parte de la organización de las actividades del equipo, con individualización de acuerdo a su especificidad. Podría estar duplicado incluso dentro de la actividad de asignación de carga de trabajo por analista.', 69, '2020-11-23 20:21:00.278465', 0, NULL, 3, 9076, NULL, NULL, 184),
	(165, 'En la descripción de algunas actividades, como ejecución de soporte con distintas áreas del INE  (CPV, CAF,  etc.) se podría reformular como generación e implementación plan de trabajo con X áreas, de acuerdo a sus requerimientos en seguridad de la información.  ', 69, '2020-11-23 20:26:40.474797', 0, NULL, 3, 9076, NULL, NULL, 150),
	(166, 'Si bien no está desarrollada la planificación con el detalle requerido, chequear la asignación de horas ya que con actividades en 2 de los 4 objetivos se está comprometiendo más del 200% de las horas del equipo.', 65, '2020-11-23 20:33:31.824696', 0, NULL, 3, 9076, NULL, NULL, 146),
	(167, 'Aunque no sea posible identificar aún los productos a evaluar en 2021, las actividades pueden formularse de manera más autocontenidas, de forma de estimar un estándar de trabajo mínimo (en tiempo y tareas) para el trabajo en 2021.', 65, '2020-11-23 20:35:41.262115', 0, NULL, 3, 9076, NULL, NULL, 147),
	(168, 'Actividades correspondientes al plan  Re-Co-Re debieran estar reportadas en objetivo de jefatura. \nEs necesario que en siguiente etapa de planificación se abra la planificación de compromisos institucionales (CDC/IGI, Riesgos, CADP, Asesoría al DOEEP). A mi juicio algunas de estas actividades sí corresponderán a innovaciones y tendrá sentido que estén en este objetivo, pero no todas.', 77, '2020-11-23 23:37:45.760385', 0, NULL, 3, 4171, 54, NULL, NULL),
