	(1282, 'La implementación de los compromisos CDC no debieran ser parte del contenido de las actividades de la unidad y no ser una actividad en si misma? El seguimiento y planificación de los CDC me parece que sí, pero no la implementación ya que debieran estar contenidas en actividades específicas: \nPara el año 2021 tenemos 2 CDC, 1 son las actividades de concientización difundidas que efectivamente se encuentran como actividades independientes en la matriz (Planificar, preparar, difundir), sin embargo, se deberá agregar una actividad de medición de impacto de dichas actividades que no se encontraban consideradas, y se desestimarán del compromiso de implementación del CDC. El 2do son los hacking éticos que realizaremos como depto. y que tiene asociadas las siguientes 5 actividades con un total de 71 hrs. por cada HE realizado, y la cantidad de HE que realizaremos el próximo año serán para 8 URL institucionales (aprox. un 10% del total de URL).\n- Realizar prueba de Seguridad \n- Realizar informe de análisis\n- Definir Plan de Acción con SDTI\n- Verificar efectividad de la solución ejecutada por SDTI\n\nDe acuerdo a lo anterior, desagregaremos estas actividades por Hacking éticos a realizar trimestralmente, y no por implementación del CDC.', '2020-12-01 18:40:40.803761', 6361, NULL, 3, 4481, 1, 69, 149),
	(1283, 'La actividad no da cuenta de la vinculación con el objetivo se solicita incorporar el compromiso asociado:\nEfectivamente debe ir asociado a Obj2, sin embargo, como se desagregarán más bien por las actividades ligadas al CDC de Hacking ético comprometido se eliminará como tal.', '2020-12-01 18:45:30.155758', 6361, NULL, 3, 4481, 1, 69, 149),
	(1284, 'Modificación ya realizada de acuerdo a lo informado en misma actividad del primer trimestre', '2020-12-01 18:47:18.420868', 6743, NULL, 3, 4481, 1, 69, 149);
